window.bookSummaryJSON = "<p><b>I’ve never fallen for a patient.</b><br> <b>But I’ve never had one quite like him.</b><br> <br> Kieran Hayes is a modern-day king: brilliant, arrogant, and ruthless. The Irish tech CEO has spent the last decade building his legacy in my city, but now he's breaking beneath the weight of his multibillion-dollar crown.<br> <br> Forced into my therapy office, he’s confident I can't help him. I'm determined to prove him wrong.<br> <br> Kieran will never know my desire to treat him stems from more than professional obligation. He doesn't remember the long-ago act of kindness that changed my life, but I've never forgotten.<br> <br> This time I'm going to save <i>him.</i><br> <br> Or so I think<i>.</i><br> <br> The more I learn about his beautiful mind, the more my professional boundaries crumble. Especially when he decides he doesn't want any boundaries—or clothes—separating us.<br> <br> Can I save him without sacrificing my ethics?<br> <br> Or will Kieran be the first man to bring me to my knees?</p> <p><b>The Dark Before Light </b>is a full-length contemporary romance with a HEA. For a detailed list of content warnings, please visit the author's website.</p>"; 
